- input: "TEXT\x1CC00459065\x1C.TEXT\x1C\x1CF3XN\x1CThe Treasurer of the PAC, Phillip
    Fraas, has provided exempt legal and accounting services during the Q2 of 2010,
    and the PAC is hereby reporting the receipt of these services, as provided for
    in 11 C.F.R. 104.3(h). Mr. Fraas's employer, Stinson Morrison Hecker, pays Mr.
    Fraas primarily based on his receipt of payments from clients for his provision
    of legal services to them. Since the services being reported here are provided
    'gratis' to the PAC, and since the firm is not paying him directly for providing
    those services, the value of his exempt legal and accounting can't be determined
    by billings or collection on the hours worked in providing those services. However,
    Mr. Fraas recorded an estimated 500 hours of work in the Q2 of 2010 for which
    he was paid $37,500 by the firm. As itemized below, he spent 6.9 of those hours
    providing the exempt legal and accounting services. The % of total hours spent
    on the exempt services comes to approximately 1%, and 1% of $37,500 is $375. Thus,
    Mr. Fraas values his exempt services during the second half of the year at $375.
    Itemization: .4 hrs-4/12; 2.0 hrs-4/14; .5 hrs-4/15; .2 hrs-4/27; .2 hrs-4/28;
    .3 hrs-6/7; .2 hrs-6/14; .2 hrs-6/16; .3 hrs-6/21; .6 hrs-6/22; 1.3 hrs-6/23;
    .4 hrs-6/28; .1 hrs-6/29; .2 hrs-6/30.\n"
